const fs = require('fs');
const path = require('path');

// Функция для выполнения HTTP запросов
async function makeRapidAPIRequest(endpoint, method, apiKey, data = null) {
  const https = require('https');

  const options = {
    hostname: 'rapidapi.com',
    port: 443,
    path: endpoint,
    method: method,
    headers: {
      'Content-Type': 'application/json',
      'X-RapidAPI-Key': apiKey
    }
  };

  if (data) {
    options.headers['Content-Length'] = Buffer.byteLength(JSON.stringify(data));
  }

  return new Promise((resolve, reject) => {
    const req = https.request(options, (res) => {
      let responseData = '';

      res.on('data', (chunk) => {
        responseData += chunk;
      });

      res.on('end', () => {
        try {
          const response = JSON.parse(responseData);
          if (res.statusCode >= 200 && res.statusCode < 300) {
            resolve(response);
          } else {
            reject(new Error('API request failed with status ' + res.statusCode + ': ' + JSON.stringify(response)));
          }
        } catch (e) {
          reject(new Error('Failed to parse response: ' + e.message));
        }
      });
    });

    req.on('error', (error) => {
      reject(new Error('Request failed: ' + error.message));
    });

    if (data) {
      req.write(JSON.stringify(data));
    }

    req.end();
  });
}

// Логирование в файл и консоль
function log(message) {
  const timestamp = new Date().toISOString();
  const logMessage = '[' + timestamp + '] ' + message + '\n';

  // Лог в файл
  fs.appendFileSync('RAPIDAPI_AUTO_PROGRESS.md', logMessage, 'utf8');

  // Вывод в консоль
  console.log(message);
}

